import React from "react";

function AnimeCard(anime) {
  return (
    <artice className="anime-card">
      <a href={anime.url}>
        <figure>
          <img src={anime.image_url} alt="Anime Image" />
        </figure>
        <h3>{anime.title}</h3>
      </a>
    </artice>
  );
}

export default AnimeCard;
